bioghist.p:
Dit bureau stond direct onder de secretaris-generaal en zijn plaatsvervanger. Een aantal taken van het bureau waren:


het assisteren van de secretaris-generaal bij diens werkzaamheden;

het behandelen van juridische en beleidsvragen van algemene aard;

het coördineren inzake departementale en interdepartementale aangelegenheden, voorzover deze niet door een bepaalde afdeling worden verzorgd;

toezicht op beroepskeuzevoorlichting door gesubsidieerde particuliere bureaus en de directie voor specialistisch arbeidsvoorzieningsbeleid van het Directoraat-Generaal voor de Arbeidsvoorziening;

werkzaamheden inzake ministerraadstukken en uitvoering van besluiten terzake.

Deze afdeling werd in de jaren veertig het Kabinet van de Minister genoemd met daaronder een administratieve dienst. Vanaf 1957 werd de afdeling Kabinets- en Administratieve Zaken ingesteld. Deze afdeling was onderverdeeld in onder andere een Kabinet van de Minister, een afdeling Algemeen Secretariaat en Personeelszaken, een onderafdeling Administratieve Zaken, een onderafdeling Post- en Archiefzaken en een onderafdeling Communicatie. De belangrijkste taken van deze afdeling waren:


het zorgdragen voor koninklijke onderscheidingen en andere zaken van algemene of geheime aard, welke niet tot een bepaalde afdeling behoren of op last van de minister worden behandeld;

het zorgdragen voor aangelegenheden van protocollaire aard;

het uitvoeren van secretariaatswerkzaamheden ten behoeve van de minister;

het organiseren van de postbehandeling en het archiefbeheer bij het ministerie en de daaronder ressorterende diensten en instellingen;

het bestellen van administratief drukwerk ten behoeve van het ministerie en de daaronder ressorterende diensten en instellingen;

het zorgdragen voor personeelsaangelegenheden, materiële voorzieningen en financiële zaken.

In de jaren zestig was de benaming Afdeling Comptabiliteit, later de Centrale Afdeling Financieel Economische Zaken. Dit veranderde in de jaren tachtig in de Centrale Directie Financieel Economische Zaken (FEZ). Een aantal belangrijke taken waren:


het uitvoeren van taken betreffende de departementale begroting, het financiële beheer en het toezicht daarop;

het zorgdragen voor het beleid over de financiële processen;

het adviseren van de directie, de ambtelijke leiding en de bewindspersonen van Sociale Zaken en Werkgelegenheid over beleidsvoornemens vanuit de optiek van doelmatigheid, doeltreffendheid, budgettaire inpasbaarheid, bekostiging- en financieringssystematiek en ordelijk financieel beheer.

Hieronder volgen de belangrijkste taken van deze afdeling:


in samenwerking met de betrokken beleidsafdelingen voorbereiden van wettelijke regelingen;

het behandelen van juridische aangelegenheden en het adviseren over de juridische aspecten van bij andere afdelingen in behandeling zijnde aangelegenheden.

Ook deze directie viel direct onder de (plv.) secretaris-generaal. Hieronder volgen een aantal taken die onder de verantwoordelijkheid van deze directie vielen:


het verzamelen, toegankelijk maken, ter beschikking stellen en beheren van literatuurgegevens die het werkterrein van het departement betreffen, zowel ten behoeve van het departement als van andere overheidsinstanties, particuliere instellingen en personen;

het verstrekken van literatuurinformatie en het uitvoeren van literatuurrecherches;

het uitgeven van een documentatieoverzicht;

het voorlichten van het publiek door middel van alle voorlichtingsmedia;

het toezicht houden op en het bestellen van publicaties van het ministerie en de daaronder ressorterende diensten en instellingen.

odd.p:
Openbare archiefstukken kunnen online worden aangevraagd en gereserveerd. U kunt dit ook via de terminals in de studiezaal van het Nationaal Archief doen. Om te kunnen reserveren dient u de volgende stappen te volgen: 

U maakt een profiel aan op www.gahetna.nl, en logt vervolgens in;

Via de archiefinventaris (alleen de beschrijvingen met rode nummers) selecteert u het gewenste archiefstuk door op de knop 'Reserveren' te klikken;

In het volgende scherm geeft u aan op welke dag u het archiefstuk wilt inzien;

Indien u zich bevindt in de studiezaal en een tafelnummer heeft ontvangen kunt u dit nummer vermelden. Als u geen tafelnummer heeft kunt u tafelnummer 777 laten staan;

Vervolgens bevestigt u uw reservering door deze te versturen.
